import styled from "styled-components";

import { Flex } from "../../defaultStyles"
import logout from "./logout.svg";
import profile from "./profile.svg";

const Link = styled.a`
font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 16px;
line-height: 24px;
color: #666F9C;
`
;
export const LinksWrapper: React.FC = () => {
    return (
        <Flex>
            <Flex><img src={profile} />
                <span>My Account</span>
            </Flex>
            <Flex>
                <img src={logout} />
                <Link>Logout</Link>
            </Flex>
        </Flex>
    )
}
